"use strict";(self.webpackChunkdocs=self.webpackChunkdocs||[]).push([[477],{10:function(e){e.exports=JSON.parse('{"blogPosts":[{"id":"open_chia_partnership","metadata":{"permalink":"/blog/open_chia_partnership","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-03-14-OpenChia/index.md","source":"@site/blog/2022-03-14-OpenChia/index.md","title":"Partnering with Openchia","description":"Spacescan.io got another hand to work together for helping the chia community grow faster. We are partnering with Openchia.io, a leading opensoure pool operator. Openchia pooling can be done by using either Chia GUI/CLI.","date":"2022-03-14T00:00:00.000Z","formattedDate":"March 14, 2022","tags":[{"label":"Chia","permalink":"/blog/tags/chia"},{"label":"spacescan","permalink":"/blog/tags/spacescan"},{"label":"explorer","permalink":"/blog/tags/explorer"},{"label":"charts","permalink":"/blog/tags/charts"}],"readingTime":1.245,"truncated":false,"authors":[{"name":"AjayZorro","title":"Data scientist","key":"ajayZorro"}],"frontMatter":{"slug":"open_chia_partnership","title":"Partnering with Openchia","tags":["Chia","spacescan","explorer","charts"],"authors":["ajayZorro"]},"nextItem":{"title":"Internship Program-2022","permalink":"/blog/Intern Program-2022"}},"content":"[Spacescan.io](https://www.spacescan.io/) got another hand to work together for helping the chia community grow faster. We are partnering with [Openchia.io](https://openchia.io/), a leading opensoure pool operator. Openchia pooling can be done by using either Chia GUI/CLI.  \\n\\n## OpenChia Team\\n\\nOpenchia team have more than 20 years of combined experience in the software development industry. They are one of the leading chia pool protocol. Openchia team is completely open source and anyone can suggest or contribute in their [github](https://github.com/openchia/web/issues).\\n\\nThey have many exciting features like mobile applications for monitoring the user pool, farming stats, payouts and more. The openchia mobile application is available in both [Apple store](https://apps.apple.com/us/app/openchia/id1595607176) and in [Google play store](https://play.google.com/store/apps/details?id=com.openchia&pcampaignid=pcampaignidMKT-Other-global-all-co-prtnr-py-PartBadge-Mar2515-1). \\n\\n- Most transparent pool out there!\\n\\n- Currently most profitable pool of all!\\n\\n- Native mobile app on both Android and iOS for your travels. Be alerted when blocks are found.\\n\\n- Instant payout and optional minimal payout\\n\\n- All our software (api, pool, bot, web, mobile) are open source and available on Github repositories.\\n\\n- All farmer participating in our pool are eligible in our giveaway! Tickets on farmer page\\n\\n- fast-growing and helpfull community!\\n\\n- Ever improving pool based on what our farmers need\\n\\n- Modified fullnode for Chinese farmers \\n\\n![opnChiaPartnership](./openChiaPartnership.png)\\n\\n[Open Chia Partnering with spacescan](https://openchia.io/en/partners)\\n\\n## Partnership with Spacescan\\n\\nInorder to help the chia community grow faster, spacescan and openchia joined their hands to lift the community up. We are planning to come out with exciting features that helps the user to have better user experience. \\n\\n![spacescan.ioPartnership](./SpacescanPartnership.png)"},{"id":"Intern Program-2022","metadata":{"permalink":"/blog/Intern Program-2022","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-03-10-InternProgram/index.md","source":"@site/blog/2022-03-10-InternProgram/index.md","title":"Internship Program-2022","description":"Spacescan.io team is planning to expand its boundaries by hosting Internship programs. We are welcoming college/University students for a fully remote internship globally.","date":"2022-03-10T00:00:00.000Z","formattedDate":"March 10, 2022","tags":[{"label":"Chia","permalink":"/blog/tags/chia"},{"label":"spacescan","permalink":"/blog/tags/spacescan"},{"label":"explorer","permalink":"/blog/tags/explorer"},{"label":"charts","permalink":"/blog/tags/charts"}],"readingTime":1.8,"truncated":false,"authors":[{"name":"AjayZorro","title":"Data scientist","key":"ajayZorro"}],"frontMatter":{"slug":"Intern Program-2022","title":"Internship Program-2022","tags":["Chia","spacescan","explorer","charts"],"authors":["ajayZorro"]},"prevItem":{"title":"Partnering with Openchia","permalink":"/blog/open_chia_partnership"},"nextItem":{"title":"Mempool Min Fees Trend","permalink":"/blog/Mempool_Min_Fees_Trend"}},"content":"[Spacescan.io](https://www.spacescan.io/) team is planning to expand its boundaries by hosting Internship programs. We are welcoming college/University students for a fully remote internship globally.\\n\\n Spacescan will provide the students with the knowledge on how to build softwares in a professional working environment. Interns will learn blockchain, Crypto- transactions, Artificial Intelligence and Machine Learning on large datasets. Students working with spacescan will be making a huge impact to the chia community and thousands of spacscan users. \\n\\nSpacesan provides different tasks, projects and meaningful mentorship to the students, so that they can learn new stuffs out of their academics. For interns, we exclusively host a hybrid model, where the interns will not join the daily meeting or call, but will be part of the daily tasks and spacescan updates. Tasks will be allocated in the spacescan [github portal](https://github.com/spacescan-io), Interns can pick and work on the tasks that they like to work on. \\n\\n## Apply here \\n\\nSpacescan really appreciate each and every canditate who applies for the internship as they are making a huge forward step in their career. \\n\\n:::info Apply Here\\n\\n[Application Link!](https://forms.gle/dSMFa7rT7u3dERsT7)\\n\\n:::\\n\\n## What Interns will get from Spacescan.io Internship\\n\\n- Working with Founding team of software engineers and Architects from fortune 100 companies with more than 15 years of experience from USA and Canada.\\n\\n- Highly motivated team and passionate about the blockchain technologies.\u200b\\n\\n- Leading chia blockchain explorer in the market with exclusive features. \\n\\n- The only analytical platform that provides in-depth on-chain metrics, interactive charts, and APIs for enterprises in chia blockchain.\u200b\\n\\n- On completion of 6-months intern period, experience certificate will be provided from spacescan.io. \u200b\\n\\n## Eligible Criteria \\n\\nThere are few criterion, that we follow for the interning with spacescan. \\n\\n- Should be an active\xa0student in college/University.\\n\\n- Should commit weekly 10 hours for learning and contributions\\n\\n- Must have knowledge in node.js &\xa0React.js.\\n\\n- Having knowledge in blockchain, chialisp, python is an advantage.\\n\\n- Self-motivated and passionate about learning\xa0new technologies.\\n\\n- Interns might have initial screening via zoom.\\n\\nInterns will have an opportunity to work with spacescan.io team after the completion of intern period based on the performance and interest towards the chia community. \\n\\n\\n\\n![background_non_footer](./background_non_footer.jpg)"},{"id":"Mempool_Min_Fees_Trend","metadata":{"permalink":"/blog/Mempool_Min_Fees_Trend","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-03-09-dailyupdates/index.md","source":"@site/blog/2022-03-09-dailyupdates/index.md","title":"Mempool Min Fees Trend","description":"Spacescan.io is an initiative mainly developed for the chia community to explore the chia blockchain. Spacescan is an easy accessible blockchain explorer and analytics platform with indepth details about the chia blockchain.","date":"2022-03-09T00:00:00.000Z","formattedDate":"March 9, 2022","tags":[{"label":"Chia","permalink":"/blog/tags/chia"},{"label":"spacescan","permalink":"/blog/tags/spacescan"},{"label":"explorer","permalink":"/blog/tags/explorer"},{"label":"charts","permalink":"/blog/tags/charts"},{"label":"announcements","permalink":"/blog/tags/announcements"}],"readingTime":1.115,"truncated":false,"authors":[{"name":"AjayZorro","title":"Data scientist","key":"ajayZorro"}],"frontMatter":{"slug":"Mempool_Min_Fees_Trend","title":"Mempool Min Fees Trend","tags":["Chia","spacescan","explorer","charts","announcements"],"authors":["ajayZorro"]},"prevItem":{"title":"Internship Program-2022","permalink":"/blog/Intern Program-2022"},"nextItem":{"title":"Mempool Cost trend","permalink":"/blog/Mempool_Cost_trend"}},"content":"[Spacescan.io](https://www.spacescan.io/) is an initiative mainly developed for the chia community to explore the chia blockchain. Spacescan is an easy accessible blockchain explorer and analytics platform with indepth details about the chia blockchain.\\n\\n## Min chia transactions fees\\n\\nDuring dust storms, you can use the below min fees to get transactions in next block.\\nWe calculate fees based on 5M cost estimate and this is more than enough to get your transaction into next block in chia block chain.\\n\\n![Chiatothemoon Plushie](./Min_fees.PNG)\\n\\n## Min fees trend chart\\n\\nSpacescan added new chart exclusively for mempool Min Fees. Initially, this mempool min fees were combined with mempool fees chart. To bring clarity, now mempool Min fees are seprated into its own chart to bring the trend.\\n\\n![Chiatothemoon Plushie](./mempoolmin.png)\\n\\n## Navigation\\n\\nThis new change can be viewed in the spacescan explorer, under the charts sections. Inside the chart dropdown section, there is a dedicated column for the mempool, where we can find the link for mempool min fees. This would give the min fees in mojos for 5M cost transactions.\\n \\nThe one month and one year mempool min fees details might take some time to load as the we have been storing the min fees data for few weeks.\\n\\n![Chiatothemoon Plushie](./select_chart.png)\\n\\nProvide your feedbacks, suggestions, bugs and new feature recommendation in our [discord](https://discord.com/invite/Bb4sj3Bg9P), [twitter](https://twitter.com/spacescan_io), [github](https://github.com/spacescan-io/web/issues) or at `spacescan.io@gmail.com`"},{"id":"Mempool_Cost_trend","metadata":{"permalink":"/blog/Mempool_Cost_trend","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-03-03-newUpdates/index.md","source":"@site/blog/2022-03-03-newUpdates/index.md","title":"Mempool Cost trend","description":"Spacescan.io is an initiative mainly developed for the chia community to explore the chia blockchain. Spacescan is an easy accessible blockchain explorer and analytics platform with indepth details about the chia blockchain.","date":"2022-03-03T00:00:00.000Z","formattedDate":"March 3, 2022","tags":[{"label":"Chia","permalink":"/blog/tags/chia"},{"label":"spacescan","permalink":"/blog/tags/spacescan"},{"label":"explorer","permalink":"/blog/tags/explorer"},{"label":"charts","permalink":"/blog/tags/charts"},{"label":"announcements","permalink":"/blog/tags/announcements"}],"readingTime":0.845,"truncated":false,"authors":[{"name":"JagRudh","title":"Architect","key":"jagRudh"}],"frontMatter":{"slug":"Mempool_Cost_trend","title":"Mempool Cost trend","tags":["Chia","spacescan","explorer","charts","announcements"],"authors":["jagRudh"]},"prevItem":{"title":"Mempool Min Fees Trend","permalink":"/blog/Mempool_Min_Fees_Trend"},"nextItem":{"title":"Welcome","permalink":"/blog/welcome"}},"content":"[Spacescan.io](https://www.spacescan.io/) is an initiative mainly developed for the chia community to explore the chia blockchain. Spacescan is an easy accessible blockchain explorer and analytics platform with indepth details about the chia blockchain.\\n\\nAs per user request, spacescan added new chart exclusively for mempool cost and removed combined mempool fees and mempool min fees together. \\nHence, users can view the fees and min fees in a chart together and can view the mempool cost chart seperately. \\n\\n![Chiatothemoon Plushie](./mempoolchart.png)\\n\\n## API Documentation\\n\\n[Spacescan.io](https://www.spacescan.io/) is now providing the link to the documentation website [docs.spacescan.io](https://docs.spacescan.io/) from the explorer. So, the developers can navigate themselves from the spacescan explorer to the documentation website, from which they can integrate and learn about the API and other spacescan information.\\n\\nUsers can click or hover over the settings navigation bar in the top of spacscan explorer. Inside the settings, navigation dropdown users can find out the API documentation. \\n\\n![dropdown Pics](./navBar.png)\\n\\nProvide your feedbacks, suggestions, bugs and new feature recommendation in our [discord](https://discord.com/invite/Bb4sj3Bg9P), [twitter](https://twitter.com/spacescan_io), [github](https://github.com/spacescan-io/web/issues) or at `spacescan.io@gmail.com`"},{"id":"welcome","metadata":{"permalink":"/blog/welcome","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-02-27-welcome/index.md","source":"@site/blog/2022-02-27-welcome/index.md","title":"Welcome","description":"Spacescan.io is an initiative mainly developed for the chia community to explore the chia blockchain. Spacescan is an easy accessible blockchain explorer and analytics platform with indepth details about the chia blockchain. Spacescan is developed by three friends, who works on weekends and started this out of passion and frustration","date":"2022-02-27T00:00:00.000Z","formattedDate":"February 27, 2022","tags":[{"label":"Chia","permalink":"/blog/tags/chia"},{"label":"spacescan","permalink":"/blog/tags/spacescan"},{"label":"explorer","permalink":"/blog/tags/explorer"}],"readingTime":0.69,"truncated":false,"authors":[{"name":"Natsabari","title":"Founder, Architect","key":"natsabari"}],"frontMatter":{"slug":"welcome","title":"Welcome","tags":["Chia","spacescan","explorer"],"authors":["natsabari"]},"prevItem":{"title":"Mempool Cost trend","permalink":"/blog/Mempool_Cost_trend"}},"content":"[Spacescan.io](https://www.spacescan.io/) is an initiative mainly developed for the chia community to explore the chia blockchain. Spacescan is an easy accessible blockchain explorer and analytics platform with indepth details about the chia blockchain. Spacescan is developed by three friends, who works on weekends and started this out of passion and frustration \\nwith the current explorers. Spacescan is now under rapid development and undergo frequent updates.  \\nSpacescan.io mainly focus on the user preference and provides features that are requested by the user.\\nSuggestions and feature recommendations are always open to help the community grow better and faster. \\nSpacescan.io is started to proivde more user-friendly, mature and professional experience for chia blockchain, which is \\navailable for other crypto platforms other than chia.  \\n\\n![Chiatothemoon Plushie](./chiatothemoon.jpg)\\n\\nProvide your feedbacks, suggestions, bugs and new feature recommendation in our [discord](https://discord.com/invite/Bb4sj3Bg9P), [twitter](https://twitter.com/spacescan_io), [github](https://github.com/spacescan-io/web/issues) or at `spacescan.io@gmail.com`"}]}')}}]);